import React from 'react';
import './App.css';

class Square extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            value: props.value,
        };
    }

    render() {
        return (
            <button className="Square" onclick={()=>this.state.onclick()}>
                {this.state.value}
            </button>
        );
    }
}

